// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import HomePage from './H';

const root = document.getElementById('root');

const render = (HomePage) => {
  ReactDOM.createRoot(root).render(
    <React.StrictMode>
      <HomePage/>
    </React.StrictMode>
  );
};

render(HomePage);
